    function initBanViewer() {
        return
        let allData = [];
        let currentCommuneData = [];

        const uploadBtn = $id("upload-btn");
        uploadBtn.addEventListener('click', () => fileInput.click());

        fileInput.addEventListener('change', (e) => {
            const file = e.target.files[0];
            if (!file) return;

            listDiv.innerHTML = '<b>Lecture du fichier BAN...</b><br>';
            allData = [];
            currentCommuneData = [];

            const reader = new FileReader();

            reader.onload = (event) => {
                const text = event.target.result;
                const lines = text.split(/\r?\n/);

                const headers = lines[0].split(';').map(h => h.trim().toLowerCase());
                const voieIdx = headers.indexOf('voie_nom');
                const numIdx = headers.indexOf('numero');
                const comIdx = headers.indexOf('commune_nom');
                const lonIdx = headers.indexOf('long');
                const latIdx = headers.indexOf('lat');

                if ([voieIdx, numIdx, comIdx, lonIdx, latIdx].includes(-1)) {
                    listDiv.innerHTML = "‚ùå Colonnes n√©cessaires non trouv√©es.";
                    return;
                }

                for (let i = 1; i < lines.length; i++) {
                    const line = lines[i];
                    if (!line.trim()) continue;
                    const cells = line.split(';');
                    allData.push({
                        voie: cells[voieIdx],
                        num: cells[numIdx],
                        commune: cells[comIdx],
                        lon: parseFloat(cells[lonIdx]),
                        lat: parseFloat(cells[latIdx])
                    });
                }

                // Filtre communes uniques
                const uniqueCommunes = [...new Set(allData.map(d => d.commune).filter(Boolean))].sort();
                communeSelect.innerHTML = '<option value="">-- Choisir une commune --</option>' +
                    uniqueCommunes.map(c => `<option value="${c}">${c}</option>`).join('');
                communeSelect.style.display = "block";

                listDiv.innerHTML = `<b>‚úÖ Fichier charg√© (${allData.length} lignes)</b><br><br>`;
            };

            reader.readAsText(file, 'utf-8');
        });

        // --- Filtrer par commune ---
        communeSelect.addEventListener('change', (e) => {
            const selectedCommune = e.target.value;
            if (!selectedCommune) {
                listDiv.innerHTML = '';
                voieSelect.style.display = 'none';
                return;
            }

            currentCommuneData = allData.filter(d => d.commune === selectedCommune);

            // Filtre voies uniques dans la commune
            const uniqueVoies = [...new Set(currentCommuneData.map(d => d.voie).filter(Boolean))].sort();
            voieSelect.innerHTML = '<option value="">-- Toutes les voies --</option>' +
                uniqueVoies.map(v => `<option value="${v}">${v}</option>`).join('');
            voieSelect.style.display = "block";

            renderList(currentCommuneData);
        });

        // --- Filtrer par voie ---
        voieSelect.addEventListener('change', (e) => {
            const selectedVoie = e.target.value;
            const dataToShow = selectedVoie
                ? currentCommuneData.filter(d => d.voie === selectedVoie)
                : currentCommuneData;
            renderList(dataToShow);
        });

        // --- Fonction d'affichage batch pour pas laguer ---
        function renderList(data) {
            const listDiv = tabPane.querySelector('#list-ban');
            listDiv.innerHTML = `<b>${data.length}</b> lignes affich√©es<br><br>`;

            const fragment = document.createDocumentFragment();
            const batchSize = 500;
            let index = 0;

            function renderBatch() {
                const slice = data.slice(index, index + batchSize);
                slice.forEach((d) => {
                    // cr√©er un √©l√©ment parent
                    const lineDiv = document.createElement('div');
                    lineDiv.style.display = 'flex';
                    lineDiv.style.flexDirection = 'column';
                    lineDiv.style.borderBottom = '1px solid #ddd';
                    lineDiv.style.padding = '5px';
                    lineDiv.style.width = '100%';
                    lineDiv.style.cursor = 'pointer';
                    lineDiv.style.borderRadius = '10px';

                    // contenu HTML
                    lineDiv.innerHTML = `
                                            <div class="infoMid" style="color: rgb(150,150,150); font-size: 12px;">${d.commune || ''}</div>
                                            <div class="infoLeft" style="font-size: 15px; font-weight: bold;">${d.num || ''} ${d.voie || ''}</div>
                                            `;

                    // survol gris clair
                    lineDiv.addEventListener('mouseover', () => {
                        lineDiv.style.backgroundColor = '#ddd';
                    });
                    lineDiv.addEventListener('mouseout', () => {
                        lineDiv.style.backgroundColor = '';
                    });

                    // clic pour centrer la carte
                    lineDiv.addEventListener('click', () => {
                        if (!isNaN(d.lat) && !isNaN(d.lon)) {
                            wmeSDK.Map.setMapCenter({ lonLat: { lat: d.lat, lon: d.lon }, zoomLevel: 19 });
                            navigator.clipboard.writeText(d.voie);
                        } else {
                            alert('Coordonn√©es invalides');
                        }
                    });

                    fragment.appendChild(lineDiv);
                });

                listDiv.appendChild(fragment);
                index += batchSize;

                if (index < data.length) {
                    setTimeout(renderBatch, 10);
                }
            }
            renderBatch();
        }
    }
